import { sql } from "drizzle-orm";
import { boolean as boolean5, index as index2, jsonb, pgTable, text as text2, timestamp, uuid as uuid5, vector as vector2 } from "drizzle-orm/pg-core";
var documents = pgTable("documents", {
  id: uuid5("id").primaryKey().defaultRandom(),
  filePath: text2("file_path").notNull().unique(),
  content: text2("content").notNull(),
  contentUpdatedAt: timestamp("content_updated_at"),
  plainText: text2("plain_text").notNull(),
  embedding: vector2("embedding", { dimensions: 768 }),
  embeddingGeneratedAt: timestamp("embedding_generated_at"),
  lastCommitHash: text2("last_commit_hash"),
  lastCommitDate: timestamp("last_commit_date"),
  createdAt: timestamp("created_at").notNull().defaultNow(),
  updatedAt: timestamp("updated_at").notNull().defaultNow()
}, (table) => [
  index2("documents_plain_text_idx").using("gin", sql`to_tsvector('english', ${table.plainText})`),
  index2("documents_embedding_idx").using("hnsw", table.embedding.op("vector_cosine_ops")),
  index2("documents_file_path_idx").on(table.filePath)
]);
var wikiLinks = pgTable("wiki_links", {
  id: uuid5("id").primaryKey().defaultRandom(),
  sourceDocumentId: uuid5("source_document_id").notNull().references(() => documents.id, { onDelete: "cascade" }),
  targetDocumentId: uuid5("target_document_id").references(() => documents.id, { onDelete: "set null" }),
  linkText: text2("link_text").notNull(),
  isBroken: boolean5("is_broken").notNull().default(false),
  occurrences: jsonb("occurrences").$type().notNull(),
  createdAt: timestamp("created_at").notNull().defaultNow(),
  updatedAt: timestamp("updated_at").notNull().defaultNow()
}, (table) => [
  index2("wiki_links_source_doc_idx").on(table.sourceDocumentId),
  index2("wiki_links_target_doc_idx").on(table.targetDocumentId),
  index2("wiki_links_link_text_idx").on(table.linkText)
]);
var tags = pgTable("tags", {
  id: uuid5("id").primaryKey().defaultRandom(),
  name: text2("name").notNull().unique(),
  createdAt: timestamp("created_at").notNull().defaultNow()
}, (table) => [
  index2("tags_name_idx").on(table.name)
]);
var documentTags = pgTable("document_tags", {
  id: uuid5("id").primaryKey().defaultRandom(),
  documentId: uuid5("document_id").notNull().references(() => documents.id, { onDelete: "cascade" }),
  tagId: uuid5("tag_id").notNull().references(() => tags.id, { onDelete: "cascade" }),
  createdAt: timestamp("created_at").notNull().defaultNow()
}, (table) => [
  index2("document_tags_document_idx").on(table.documentId),
  index2("document_tags_tag_idx").on(table.tagId)
]);

