import { Effect as Effect7 } from "effect";
function expandGraph(seeds, maxDepth, projectDb) {
  return Effect7.gen(function* () {
    const discovered = new Map;
    for (const seed of seeds) {
      discovered.set(seed.id, {
        id: seed.id,
        filePath: seed.filePath,
        plainText: seed.plainText,
        distanceFromSeed: 0,
        nearestSeedId: seed.id,
        pathToSeed: [seed.id],
        tags: seed.tags
      });
    }
    const queue = seeds.map((s) => ({
      id: s.id,
      distance: 0,
      nearestSeedId: s.id,
      path: [s.id]
    }));
    let queueIndex = 0;
    while (queueIndex < queue.length) {
      const current = queue[queueIndex];
      queueIndex++;
      if (current.distance >= maxDepth) {
        continue;
      }
      const currentLayerIds = [];
      while (queueIndex - 1 < queue.length && queue[queueIndex - 1].distance === current.distance) {
        currentLayerIds.push(queue[queueIndex - 1].id);
        queueIndex++;
      }
      queueIndex--;
      const neighbors = yield* projectDb.getBatchNeighbors([current.id]);
      for (const neighbor of neighbors) {
        if (discovered.has(neighbor.id)) {
          continue;
        }
        const graphDoc = {
          id: neighbor.id,
          filePath: neighbor.filePath,
          plainText: "",
          distanceFromSeed: current.distance + 1,
          nearestSeedId: current.nearestSeedId,
          pathToSeed: [...current.path, neighbor.id],
          tags: []
        };
        discovered.set(neighbor.id, graphDoc);
        queue.push({
          id: neighbor.id,
          distance: current.distance + 1,
          nearestSeedId: current.nearestSeedId,
          path: graphDoc.pathToSeed
        });
      }
    }
    return Array.from(discovered.values());
  });
}

